import React from 'react';
import useAuth from '../../LoginHooks/useAuth';

const Login = () => {
    const {SigninUsingGoole}=useAuth()
    return (
        <div>
            <h2>please Login:</h2>
            <button  className="btn btn-warning">Google Sign In</button>
        </div>
    );
};

export default Login;
